window.bookSummaryJSON = "<p>Stanley peered up into the shadows above the stage. There was a colorful blaze of fabric amidst the burgundy curtains and canvas backdrops. He moved closer, trying to get a better view from a different angle. </p> <p>Faye McMullen was murdered in cold blood at Winneshiek Theater, and Mary O'Reilly and Police Chief Bradley Alden have to discover who done it before the murderer gets the chance to get rid of the prime witness...Mary O'Reilly. </p>"; 
